function destroyer(arr) {
    // Remove all the values
    let args=Array.from(arguments)
    args.splice(0,1)
    var target=args
    let result=[]

    for(let num of arr){
        if(target.indexOf(num)===-1){
            result.push(num)
        }
    }
    return result;
  }

  destroyer([1, 2, 3, 1, 2, 3], 2, 3);
